import React from 'react'
import {Consumer} from "./DataProvider"

function Chart() {
    //need helper functions to parse data & determine chart type
    return (
        <Consumer>
            {value => (
                <div className="chart">
                {value.data.status}
            </div>)}
        </Consumer>
    )
}

export default Chart
